var __index = {"config":{"lang":["en"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"Welcome to MkDocs","text":"<p>For full documentation visit mkdocs.org.</p>"},{"location":"index.html#commands","title":"Commands","text":"<ul> <li><code>mkdocs new [dir-name]</code> - Create a new project.</li> <li><code>mkdocs serve</code> - Start the live-reloading docs server.</li> <li><code>mkdocs build</code> - Build the documentation site.</li> <li><code>mkdocs -h</code> - Print help message and exit.</li> </ul>"},{"location":"index.html#project-layout","title":"Project layout","text":"<pre><code>mkdocs.yml    # The configuration file.\ndocs/\n    index.md  # The documentation homepage.\n    ...       # Other markdown pages, images and other files.\n</code></pre>"},{"location":"about.html","title":"About Me(here is a change made)","text":""},{"location":"about.html#iacentia-in-nimius-exit","title":"Iacentia in nimius exit","text":"<p>Lorem markdownum Ceyx petiisse utque muros, aera est; Vix utque incurvis tanta hunc: captus. Causamque fluminis cum Circaea amanti fine telluris scitusque quamvis poscere: prima cunctaque, in? Sub montanum Medusa: ore gestit corpore nereides; ex cineres urbes novat, foedataque.</p> <ul> <li>Velatus coronam</li> <li>Vos optandi viscera te ossa in ademptae</li> <li>Praetereo morsus herbis die</li> <li>Qui rubet</li> <li>Medio metiris</li> <li>Sibi arcere Erectheus inmemor incingitur dixit numeratur</li> </ul> <p>Agam valet et utero caeruleus donec cultores exempla, Achillis nec domos vincula securum genetrice nives? Ita eris forma sinu: pater ait manet.</p> <ol> <li>Sum facta forte turis paenituit nectare tofis</li> <li>Et vinctus fert fratrum</li> <li>Ille longe agat</li> <li>Tulit convivia duratos praesagaque clamore</li> </ol>"},{"location":"about.html#et-manibus-animis-naturae-instruis","title":"Et manibus animis naturae instruis","text":"<p>Asida proque et altera plagae est ille quoque veniam credensque humani spoliabitur! Atra certamina arvis semper?</p> <p>Non ebur ut qui nec Padumque tempore coniugis coeperat tantaeque belli pietatem fluxerunt maris. Promissa voluptas; relicta suos. Iuli noscar. Et aspice patulos turbata squamigeris Phlegraeis igne.</p> <p>Ambo undas, vestem lenius materno paruit, tenui per Cybeleia amores commune vultus. Nigrescere semine silvae caducifer gramen adspergine, armentaque vincemur pectore illum. Neque nondum, mora terga nubila tibi sinus sunt amentia erat quid porrigitur facta sint hunc terra: non.</p> <p>Ferens esses, in, ille dixit socerum debebit, corripuit. Artus neque genus! Vidi carmina trunco delubris onus.</p>"}]}